import "./App.css";
import { useEffect, useState } from "react";

function App() {
  const [data, setdata] = useState({});

  const getdata = async () => {
    const response = await fetch("http://localhost:4000");

    setdata(await response.json());
    console.log(data);
  };

  useEffect(() => {
    getdata();
  }, []);
}

export default App;
